import React from "react";
import { useParams } from "react-router-dom";

const Home = () => {
  let params = useParams();

  return (
    <>
      <div>
        <h1>Home pageeeee</h1>
        <p>{params.id}</p>
        <p>{params.username}</p>
        <p>{params.role}</p>
      </div>

      <div className="post_report">

        <button></button>
        PostReport</div>
      <div className="view_report">PostReport</div>
    </>
  );
};

export default Home;
